import java.util.Arrays;

// https://leetcode.com/problems/find-the-difference/
public class FindTheDifference {
    public static void main(String[] args) {
        FindTheDifferenceSolution findTheDifferenceSolution = new FindTheDifferenceSolution();
        System.out.println(findTheDifferenceSolution.findTheDifference("",
                ""));
    }
}

class FindTheDifferenceSolution {
    public char findTheDifference(String s, String t) {
        char[] charStringS = s.toCharArray();
        char[] charStringT = t.toCharArray();

        Arrays.sort(charStringS);
        Arrays.sort(charStringT);

        for (int i=0; i<charStringT.length-1; i++) {
            if (charStringS[i] != charStringT[i]) {
                return charStringT[i];
            }
        }
        return charStringT[charStringT.length-1];
    }
}